import React from 'react';
import { PieChart, PieArcSeries } from 'reaviz'; // to download library, in terminal enter: "npm i reaviz"

const dataEI = [
  { key: 'I', data: 55 },
  { key: 'E', data: 45 }
];

const dataSN = [
  { key: 'S', data: 60 },
  { key: 'N', data: 40 }
];

const dataTF = [
  { key: 'T', data: 70 },
  { key: 'F', data: 30 }
];

const dataJP = [
  { key: 'J', data: 65 },
  { key: 'P', data: 35 }
];

const CompatabilityCharts = () => (
  <div className="chart-container" id="comp">
    <div className="chart-wrap" id="comp">
      <PieChart
        width={250}
        height={250}
        data={dataEI}
        series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
      />
    </div>
    <div className="chart-wrap" id="comp">
      <PieChart
        width={250}
        height={250}
        data={dataSN}
        series={<PieArcSeries colorScheme={['#BEB8EB', '#022B3A']} />}
      />
    </div>
    <div className="chart-wrap" id="comp">
      <PieChart
        width={250}
        height={250}
        data={dataTF}
        series={<PieArcSeries colorScheme={['#E3EEE2', '#ACD1E9']} />}
      />
    </div>
    <div className="chart-wrap" id="comp">
      <PieChart
        width={250}
        height={250}
        data={dataJP}
        series={<PieArcSeries colorScheme={['#F49A9A91', '#E0E0E2']} />}
      />
    </div>
  </div>
);

function Compatability() {
  return (
    <div className="mainmbti">
        <header>
            <h1 className="compheader">My MBTI Assessment</h1>
        </header>
        <div className="mbtibody">
            <CompatabilityCharts />
        </div>
        <div className="compdesc">
            <Assessment title={dataEI} kind="Introverted" />
            <Assessment title={dataSN} kind="Intuitive" />
            <Assessment title={dataTF} kind="Feeling" />
            <Assessment title={dataJP} kind="Judging" />
        </div>
    </div>
  );
}


function Assessment(props) {
    const titleData = props.title;
    // const percentage = props.percentage;
    const kind = props.kind;
    let description = '';

    const descriptions = {
        'E': 'Extraverted',
        'I': 'Introverted',
        'S': 'Observant',
        'N': 'Intuitive',
        'T': 'Thinking',
        'F': 'Feeling',
        'J': 'Judging',
        'P': 'Prospecting'
    };

    const first = titleData[0].key;
    const second = titleData[1].key;

    if (descriptions[first] && descriptions[first] !== kind) {
        description = descriptions[first];
    } else if (descriptions[second] && descriptions[second] !== kind) {
        description = descriptions[second];
    } else {
        description = 'no input!';
    }

    const className = first.toLowerCase() + 'circle';
    const firstLetterLower = className.replace('circle', '');

    return (
        <div className="assessment-container">
            <div className="desc" id={firstLetterLower}>
                <p>
                    You are <b>{titleData[0].data}%</b> more <b><em>{kind}</em></b> than {description}.
                </p>
            </div>
        </div>
    );
}

export { Compatability };
